import './fonts/MSignUp.css';

import { useLocation } from 'react-router-dom';
import { useNavigate } from "react-router";
import React, { useEffect, useState } from "react";
function Merchant() {

  const location = useLocation();
  const history = useNavigate();
  const [block, setBlock] = useState("");
  const [lot, setLot] = useState("");
  const [zipcode, setZipCode] = useState("");
  return (
    <div class="background">
    <div class="colorspace">
      <p class="heading">S I G N &nbsp; U P</p>
      <div class="shopimg"/>
    </div>
    <div class="whitespace">
      <p class="loginheading">Resident</p>
      <input class="input" placeholder='Block' value={block} 
          onChange={(e) => setBlock(e.target.value)}></input>
      <input class="input" placeholder='Lot' value={lot}
          onChange={(e) => setLot(e.target.value)}></input>
      <input class="input" placeholder='Zip Code' value={zipcode}
          onChange={(e) => setZipCode(e.target.value)}></input>
      <button class="nstep">Next Step</button>
      <div class="btext">
        <p class="btexta">Already have an account?</p>
        <button class="btextb" 
        onClick={(e) => {
          window.location.href = "/signin";
        }}>Login</button>
      </div>
    </div>
    </div>
  )
}
export default Merchant;
